import { useParams } from "react-router-dom";
import Navbar from "../Navbar";
import Side from "../Side";
import Sidebar from "../Sidebar";
import { useEffect, useState } from "react";
import AuthorChannelLayer from "./AuthorChannelLayer";
import AuthorChannelButtons from "./AuthorChannelButtons";
import { Helmet } from "react-helmet";

function AuthorChannelHome({ userInfo, authorinfo, authorslug }){

    return (
        
        <>
        <Helmet>
            <title>{`${authorinfo.channe}`}</title>
        </Helmet>
            {authorinfo.channelname}      
        </>
    )
}
export default AuthorChannelHome;
